import React, { Component } from 'react'; import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import Home from './components/Home';
import Contact from './components/Contact';
import Customiser from './components/Customiser';


class App extends Component {
  render() {
  return (
  <div className="App">
    <BrowserRouter>
      <Switch>
        <Route match exact path='/' component={Home}></Route>
        <Route match exact path='/contact' component={Contact}></Route>
        <Route match exact path='/customiser' component={Customiser}></Route>
      </Switch>
    </BrowserRouter>
    <header className="App-header">
      <img src={logo} height='200px' alt="logo" />
      <h1>Index</h1>
    </header>
  </div>
    );
  }
}


export default App;
